@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .

atm:CashCard rdf:type owl:Class .
atm:SerialNumber rdf:type owl:Class .
atm:Log rdf:type owl:Class .

atm:hasSerialNumber rdf:type owl:ObjectProperty ;
    rdfs:domain atm:CashCard ;
    rdfs:range atm:SerialNumber .

atm:isLogged rdf:type owl:ObjectProperty ;
    rdfs:domain atm:SerialNumber ;
    rdfs:range atm:Log .

atm:CashCard rdfs:subClassOf [
    rdf:type owl:Restriction ;
    owl:onProperty atm:hasSerialNumber ;
    owl:someValuesFrom [
        rdf:type owl:Restriction ;
        owl:onProperty atm:isLogged ;
        owl:someValuesFrom atm:Log
    ]
] .
